import * as React from "react";
import {
  View,
  Text,
  StyleSheet,
  Image,
  ImageBackground,
  Pressable,
} from "react-native";
import { FontFamily, FontSize, Border, Color, Padding } from "../GlobalStyles";

const LiveView = () => {
  return (
    <View style={styles.live}>
      <View style={styles.liveClassroomParent}>
        <Text style={styles.liveClassroom}>Live classroom</Text>
        <Text style={[styles.am, styles.amTypo]}>10:00 AM</Text>
      </View>
      <View style={styles.profile}>
        <Image
          style={styles.profileChild}
          resizeMode="cover"
          source={require("../assets/ellipse-1.png")}
        />
        <View style={styles.userProfile}>
          <Text style={styles.liveClassroom}>Computer Graphics</Text>
          <Text style={[styles.lecNdithi, styles.lecNdithiTypo]}>
            Lec ndithi
          </Text>
        </View>
      </View>
      <View style={styles.details}>
        <Text style={[styles.topicRasterization, styles.lecNdithiTypo]}>
          Topic: Rasterization
        </Text>
        <Text style={[styles.eventsAssignmentAttendance, styles.lecNdithiTypo]}>
          Events: Assignment, Attendance, poll
        </Text>
      </View>
      <View style={styles.profile}>
        <View style={styles.present}>
          <ImageBackground
            style={styles.cb1Icon}
            resizeMode="cover"
            source={require("../assets/cb1.png")}
          />
          <ImageBackground
            style={[styles.dj11Icon, styles.iconLayout]}
            resizeMode="cover"
            source={require("../assets/dj11.png")}
          />
          <ImageBackground
            style={[styles.influ11Icon, styles.iconLayout]}
            resizeMode="cover"
            source={require("../assets/influ11.png")}
          />
          <ImageBackground
            style={[styles.dj11Icon, styles.iconLayout]}
            resizeMode="cover"
            source={require("../assets/nastyblak3.png")}
          />
        </View>
        <Text style={[styles.more, styles.amTypo]}>+20 more</Text>
      </View>
      <Pressable style={styles.joinbtn} onPress={() => {}}>
        <Text style={[styles.joinNow, styles.amTypo]}>Join now</Text>
      </Pressable>
    </View>
  );
};

const styles = StyleSheet.create({
  amTypo: {
    fontFamily: FontFamily.interMedium,
    fontWeight: "500",
    fontSize: FontSize.size_3xs,
    textAlign: "left",
  },
  lecNdithiTypo: {
    fontSize: FontSize.size_xs,
    fontFamily: FontFamily.interMedium,
    fontWeight: "500",
    textAlign: "left",
  },
  iconLayout: {
    marginLeft: -10,
    height: 30,
    borderRadius: Border.br_81xl,
  },
  liveClassroom: {
    fontSize: FontSize.size_smi,
    fontWeight: "600",
    fontFamily: FontFamily.interSemibold,
    textAlign: "left",
    color: Color.white,
  },
  am: {
    marginLeft: 191,
    color: Color.gray_200,
  },
  liveClassroomParent: {
    alignItems: "flex-end",
    flexDirection: "row",
  },
  profileChild: {
    width: 40,
    height: 40,
  },
  lecNdithi: {
    marginTop: 3,
    color: Color.gray_200,
  },
  userProfile: {
    marginLeft: 7,
  },
  profile: {
    alignItems: "center",
    marginTop: 10,
    flexDirection: "row",
  },
  topicRasterization: {
    color: Color.white,
  },
  eventsAssignmentAttendance: {
    marginTop: 11,
    color: Color.white,
  },
  details: {
    marginTop: 10,
  },
  cb1Icon: {
    width: 31,
    height: 30,
    borderRadius: Border.br_81xl,
  },
  dj11Icon: {
    width: 30,
  },
  influ11Icon: {
    width: 28,
  },
  present: {
    flexDirection: "row",
  },
  more: {
    marginLeft: 22,
    color: Color.white,
  },
  joinNow: {
    position: "absolute",
    top: -170,
    left: -3,
    color: Color.black,
  },
  joinbtn: {
    width: 77,
    height: 24,
    marginTop: 10,
  },
  live: {
    borderRadius: Border.br_3xs,
    backgroundColor: Color.cadetblue,
    paddingHorizontal: Padding.p_xl,
    paddingVertical: Padding.p_4xs,
    marginTop: 15,
  },
});

export default LiveView;
